import React from 'react';
import '../assets/css/ButtonJoin.css'

const ButtonJoin = () => {
    return (
        <div class="d-flex justify-content-center">
            <button type="button" class="buttonjoin">Blur</button>
            <button type="button" class="buttonjoin">Backgound</button>
        </div>
    );
}

export default ButtonJoin;
